INSERT INTO `perguntas` VALUES (1,'Qual foi a sua ação?','Digite um verbo no passado','Aqui você vai escrever uma ação que realizou, usando um verbo no passado, como \'construiu\', \'ajudou\' ou \'organizou\'. Quando clicar neste campo, você verá uma lista de verbos no passado para escolher. Você pode digitar as primeiras letras do verbo para encontrá-lo mais rápido.','2025-06-04 23:37:27'),(2,'Sobre quem ou o que você agiu?','Digite um substantivo ou qualquer palavra de uma locução substantiva','Neste campo, você vai escrever quem ou o que foi impactado pela sua ação. Pode ser uma pessoa, um objeto ou até mesmo um lugar, como \'comunidade\', \'relatório\' ou \'parque\'. Se preferir, digite as primeiras letras para encontrar sugestões.','2025-06-04 23:37:27'),(3,'Que características você percebe no objeto da sua ação?','Digite um adjetivo ou qualquer palavra de uma locução adjetiva','Aqui você vai escrever uma característica que você notou naquilo sobre o que agiu. Pode ser uma qualidade, como \'importante\', \'urgente\', ou \'bem planejado\'. Você verá sugestões enquanto digita.','2025-06-04 23:37:27'),(4,'Indique um destino ou finalidade da sua ação?','Digite um substantivo ou qualquer palavra de uma locução substantiva','Neste campo, você vai indicar o objetivo ou o lugar para onde sua ação foi direcionada. Exemplos: \'projeto\', \'moradores\' ou \'melhoria do ambiente\'. Você verá uma lista de sugestões ao clicar.','2025-06-04 23:37:27'),(5,'Indique as características desse destino ou finalidade?','Digite um adjetivo ou qualquer palavra de uma locução adjetiva','Aqui você vai descrever as características do destino ou objetivo da sua ação. Pode ser algo como \'sustentável\', \'eficiente\' ou \'acolhedor\'. Sugestões aparecerão enquanto você digita.','2025-06-04 23:37:27');
